import React from "react";
import History from "./History";

export const App = () => {
  const [histories, setHistories] = useState([new Array(9).fill(null)]);
  const [currentGameState, setCurrentGameState] = useState(histories[0]);
  const selectHistoryHandler = (gameState) => {
    setCurrentGameState(gameState);
  };
  return (
    <div className="game">
      <Board gameState />
      <History
        histories
        onSelectHistory={(gameState) => {
          selectHistoryHandler(gameState);
        }}
      />
    </div>
  );
};

export default App;
